/* eslint-disable */
<template>
  <div 
    v-if="show"
    class="file-structure-panel"
    :class="{ 'is-dragging': isDragging }"
    :style="panelStyle"
    @mousedown="handleMouseDown"
    ref="panelRef">

    <!-- 面板头部 -->
    <div class="panel-header" @mousedown.prevent="startDrag">
      <div class="panel-title">
        <span class="panel-icon" v-html="folderIcon"></span>
        <span>{{ currentFile?.name || 'File Structure' }}</span>
      </div>
      <div class="panel-controls">
        <button 
          class="panel-control-btn"
          @click="toggleCollapse"
          :title="isCollapsed ? 'Expand' : 'Collapse'">
          <span v-html="isCollapsed ? expandIcon : collapseIcon"></span>
        </button>
        <button 
          class="panel-control-btn close-btn"
          @click="closePanel"
          title="Close">
          <span v-html="closeIcon"></span>
        </button>
      </div>
    </div>

    <!-- 面板内容 -->
    <div v-if="!isCollapsed" class="panel-content">
      <!-- 文件选择器 -->
      <div class="file-selector" v-if="files.length > 1">
        <select v-model="selectedFileId" @change="onFileChange" class="file-select">
          <option v-for="file in files" :key="file.id" :value="file.id">
            {{ file.name }}
          </option>
        </select>
      </div>

      <!-- 文件信息 -->
      <div v-if="currentFile" class="file-info">
        <div class="file-meta">
          <span class="file-type">{{ getFileType(currentFile.name) }}</span>
          <span class="file-size">{{ formatFileSize(currentFile.size) }}</span>
          <span class="column-count">{{ columns.length }} columns</span>
        </div>
      </div>

      <!-- 搜索框 -->
      <div class="search-box">
        <input 
          v-model="searchQuery"
          type="text"
          placeholder="Search columns..."
          class="search-input">
        <span class="search-icon" v-html="searchIcon"></span>
      </div>

      <!-- 列列表 -->
      <div class="columns-list">
        <div class="columns-header">
          <span class="header-text">Columns</span>
          <span class="columns-count">({{ filteredColumns.length }})</span>
        </div>

        <div class="columns-container">
          <div
            v-for="column in filteredColumns"
            :key="`${currentFile?.id}-${column.name}`"
            class="column-item"
            :class="{ 'is-dragging': draggingColumn === column.name }"
            draggable="true"
            @dragstart="handleDragStart(column, $event)"
            @dragend="handleDragEnd">

            <div class="column-header">
              <span class="column-icon" v-html="getColumnIcon(column.type)"></span>
              <span class="column-name">{{ column.name }}</span>
              <span class="column-type">{{ column.type }}</span>
            </div>

            <div class="column-samples" v-if="column.sampleData && column.sampleData.length > 0">
              <div class="sample-label">Sample:</div>
              <div class="sample-values">
                <span 
                  v-for="(sample, index) in column.sampleData.slice(0, 3)" 
                  :key="index"
                  class="sample-value">
                  {{ formatSampleValue(sample) }}
                </span>
                <span v-if="column.sampleData.length > 3" class="sample-more">
                  +{{ column.sampleData.length - 3 }} more
                </span>
              </div>
            </div>

            <div class="column-stats" v-if="column.stats">
              <div class="stat-item">
                <span class="stat-label">Count:</span>
                <span class="stat-value">{{ column.stats.count }}</span>
              </div>
              <div class="stat-item" v-if="column.stats.unique">
                <span class="stat-label">Unique:</span>
                <span class="stat-value">{{ column.stats.unique }}</span>
              </div>
            </div>
          </div>
        </div>
      </div>

      <!-- 数据预览 -->
      <div class="data-preview" v-if="previewData.length > 0">
        <div class="preview-header">
          <span class="header-text">Preview</span>
          <span class="preview-count">({{ previewData.length }} rows)</span>
        </div>

        <div class="preview-table">
          <table>
            <thead>
              <tr>
                <th v-for="column in columns.slice(0, 4)" :key="column.name">
                  {{ column.name }}
                </th>
                <th v-if="columns.length > 4">...</th>
              </tr>
            </thead>
            <tbody>
              <tr v-for="(row, index) in previewData.slice(0, 5)" :key="index">
                <td v-for="column in columns.slice(0, 4)" :key="column.name">
                  {{ formatPreviewValue(row[column.name]) }}
                </td>
                <td v-if="columns.length > 4">...</td>
              </tr>
            </tbody>
          </table>
        </div>
      </div>
    </div>
  </div>
</template>

<script setup>
import { ref, computed, watch, onMounted, onUnmounted } from 'vue'
import { globalDragHandler, createDragData } from '../utils/dragDropUtils.js'
import { detectColumnType, generateSampleData } from '../utils/dataMappingUtils.js'

// Props
const props = defineProps({
  show: {
    type: Boolean,
    default: false
  },
  files: {
    type: Array,
    default: () => []
  },
  initialPosition: {
    type: Object,
    default: () => ({ x: 100, y: 100 })
  }
})

// Emits
const emit = defineEmits(['close', 'file-change'])

// 响应式数据
const panelRef = ref(null)
const selectedFileId = ref(null)
const searchQuery = ref('')
const isCollapsed = ref(false)
const isDragging = ref(false)
const draggingColumn = ref(null)
const position = ref({ ...props.initialPosition })
const previewData = ref([])

// 计算属性
const currentFile = computed(() => {
  return props.files.find(f => f.id === selectedFileId.value) || props.files[0]
})

const columns = computed(() => {
  if (!currentFile.value) return []

  // 从文件预览数据中提取列信息
  const data = currentFile.value.previewData || []
  if (data.length === 0) return []

  const firstRow = data[0]
  return Object.keys(firstRow).map(columnName => {
    const values = data.map(row => row[columnName])
    const type = detectColumnType(values)
    const sampleData = generateSampleData(values)

    return {
      name: columnName,
      type,
      sampleData,
      stats: {
        count: values.length,
        unique: new Set(values).size
      }
    }
  })
})

const filteredColumns = computed(() => {
  if (!searchQuery.value) return columns.value

  const query = searchQuery.value.toLowerCase()
  return columns.value.filter(column => 
    column.name.toLowerCase().includes(query) ||
    column.type.toLowerCase().includes(query)
  )
})

const panelStyle = computed(() => ({
  left: `${position.value.x}px`,
  top: `${position.value.y}px`,
  zIndex: isDragging.value ? 1001 : 1000
}))

// 图标
const folderIcon = '<svg width="16" height="16" viewBox="0 0 24 24" fill="currentColor"><path d="M10 4H4c-1.11 0-2 .89-2 2v12c0 1.11.89 2 2 2h16c1.11 0 2-.89 2-2V8c0-1.11-.89-2-2-2h-8l-2-2z"/></svg>'
const expandIcon = '<svg width="14" height="14" viewBox="0 0 24 24" fill="currentColor"><path d="M7 14l5-5 5 5z"/></svg>'
const collapseIcon = '<svg width="14" height="14" viewBox="0 0 24 24" fill="currentColor"><path d="M7 10l5 5 5-5z"/></svg>'
const closeIcon = '<svg width="14" height="14" viewBox="0 0 24 24" fill="currentColor"><path d="M19 6.41L17.59 5 12 10.59 6.41 5 5 6.41 10.59 12 5 17.59 6.41 19 12 13.41 17.59 19 19 17.59 13.41 12z"/></svg>'
const searchIcon = '<svg width="16" height="16" viewBox="0 0 24 24" fill="currentColor"><path d="M15.5 14h-.79l-.28-.27C15.41 12.59 16 11.11 16 9.5 16 5.91 13.09 3 9.5 3S3 5.91 3 9.5 5.91 16 9.5 16c1.61 0 3.09-.59 4.23-1.57l.27.28v.79l5 4.99L20.49 19l-4.99-5zm-6 0C7.01 14 5 11.99 5 9.5S7.01 5 9.5 5 14 7.01 14 9.5 11.99 14 9.5 14z"/></svg>'

// 方法
function getColumnIcon(type) {
  const icons = {
    'string': '<svg width="14" height="14" viewBox="0 0 24 24" fill="currentColor"><path d="M9 4v3h5v12h3V7h5V4H9zM3 12h3v7h3v-7h3V9H3v3z"/></svg>',
    'number': '<svg width="14" height="14" viewBox="0 0 24 24" fill="currentColor"><path d="M7 17h2v-6H7v6zm4 0h2V7h-2v10zm4-4h2v-2.5h-2V13z"/></svg>',
    'date': '<svg width="14" height="14" viewBox="0 0 24 24" fill="currentColor"><path d="M19 3h-1V1h-2v2H8V1H6v2H5c-1.11 0-1.99.9-1.99 2L3 19c0 1.1.89 2 2 2h14c1.1 0 2-.9 2-2V5c0-1.1-.9-2-2-2zm0 16H5V8h14v11zM7 10h5v5H7z"/></svg>',
    'boolean': '<svg width="14" height="14" viewBox="0 0 24 24" fill="currentColor"><path d="M12 2C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm-2 15l-5-5 1.41-1.41L10 14.17l7.59-7.59L19 8l-9 9z"/></svg>'
  }
  return icons[type] || icons['string']
}

function getFileType(filename) {
  const extension = filename.split('.').pop()?.toLowerCase()
  return extension ? extension.toUpperCase() : 'FILE'
}

function formatFileSize(bytes) {
  if (bytes === 0) return '0 Bytes'
  const k = 1024
  const sizes = ['Bytes', 'KB', 'MB', 'GB']
  const i = Math.floor(Math.log(bytes) / Math.log(k))
  return parseFloat((bytes / Math.pow(k, i)).toFixed(2)) + ' ' + sizes[i]
}

function formatSampleValue(value) {
  if (value === null || value === undefined) return 'null'
  if (typeof value === 'string' && value.length > 15) {
    return value.substring(0, 15) + '...'
  }
  return String(value)
}

function formatPreviewValue(value) {
  if (value === null || value === undefined) return '-'
  if (typeof value === 'string' && value.length > 10) {
    return value.substring(0, 10) + '...'
  }
  return String(value)
}

function toggleCollapse() {
  isCollapsed.value = !isCollapsed.value
}

function closePanel() {
  emit('close')
}

function onFileChange() {
  const file = currentFile.value
  if (file) {
    emit('file-change', file)
    loadPreviewData(file)
  }
}

function loadPreviewData(file) {
  // 从文件中加载预览数据
  if (file.previewData) {
    previewData.value = file.previewData.slice(0, 10)
  }
}

// 拖拽相关
let dragOffset = { x: 0, y: 0 }
let isMouseDown = false

function handleMouseDown(event) {
  if (event.target.closest('.panel-header')) return
  isMouseDown = true
}

function startDrag(event) {
  isDragging.value = true
  dragOffset.x = event.clientX - position.value.x
  dragOffset.y = event.clientY - position.value.y

  document.addEventListener('mousemove', handleMouseMove)
  document.addEventListener('mouseup', handleMouseUp)
}

function handleMouseMove(event) {
  if (!isDragging.value) return

  position.value.x = event.clientX - dragOffset.x
  position.value.y = event.clientY - dragOffset.y

  // 限制在视口内
  const rect = panelRef.value?.getBoundingClientRect()
  if (rect) {
    position.value.x = Math.max(0, Math.min(window.innerWidth - rect.width, position.value.x))
    position.value.y = Math.max(0, Math.min(window.innerHeight - rect.height, position.value.y))
  }
}

function handleMouseUp() {
  isDragging.value = false
  isMouseDown = false

  document.removeEventListener('mousemove', handleMouseMove)
  document.removeEventListener('mouseup', handleMouseUp)
}

// 列拖拽
function handleDragStart(column, event) {
  draggingColumn.value = column.name
  const dragData = createDragData(column, currentFile.value)
  globalDragHandler.startDrag(dragData, event)
}

function handleDragEnd() {
  draggingColumn.value = null
  globalDragHandler.endDrag()
}

// 生命周期
watch(() => props.files, (newFiles) => {
  if (newFiles.length > 0 && !selectedFileId.value) {
    selectedFileId.value = newFiles[0].id
  }
}, { immediate: true })

watch(() => selectedFileId.value, (newId) => {
  if (newId) {
    const file = props.files.find(f => f.id === newId)
    if (file) {
      loadPreviewData(file)
    }
  }
}, { immediate: true })

onMounted(() => {
  // 初始化位置
  if (props.files.length > 0) {
    selectedFileId.value = props.files[0].id
    loadPreviewData(props.files[0])
  }
})

onUnmounted(() => {
  document.removeEventListener('mousemove', handleMouseMove)
  document.removeEventListener('mouseup', handleMouseUp)
})
</script>

<style scoped>
.file-structure-panel {
  position: fixed;
  width: 320px;
  max-height: 80vh;
  background: var(--bg-color, #fff);
  border: 1px solid var(--border-color, #e0e0e0);
  border-radius: 8px;
  box-shadow: 0 8px 32px rgba(0, 0, 0, 0.1);
  backdrop-filter: blur(8px);
  font-family: 'Segoe UI', Tahoma, Geneva, Verdana, sans-serif;
  user-select: none;
